The change was made in Minecraft Snapshot 21w42a. Here is the relevant line of code that was updated to allow hoes to break moss blocks:

```java
// net.minecraft.world.item.HoeItem.java
@Override
public float getDestroySpeed(ItemStack stack, BlockState state) {
    if (state.is(BlockTags.MOSS_BREAKABLE) || state.is(BuiltInBlockTags.MOSS_BREAKABLE)) {
        return this.speed + 1.0F;
    } else {
        return super.getDestroySpeed(stack, state);
    }
}
